import Gauge from './Gauge.js';
import MainChart from './MainChart.js';
import WordCloud from './WordCloud.js';
import TimeLine from './TimeLine.js';
import './App.css';


function DisplayUpper({prop}) {
    return (
        <div>
            <div className="App">
                <h1>HI, {prop} </h1>
                <MainChart />
                <Gauge value min max label='Meter' units='em'/>
            </div>
            <div>
                {/* <TimeLine /> */}
                <WordCloud />
            </div>
        </div>
    );
}

export default DisplayUpper;

